import React, { useState } from 'react';
import { Card, Col, Row, Form, Container } from 'react-bootstrap';

const ProductList = () => {
    const [searchTerm, setSearchTerm] = useState('');
    const cars = [
        { id: 1, title: 'Tesla Model S', imageUrl: 'https://via.placeholder.com/400x250', description: 'Electric sedan with autopilot.' },
        { id: 2, title: 'Ford Mustang', imageUrl: 'https://via.placeholder.com/400x250', description: 'Classic muscle car with a powerful engine.' },
        { id: 3, title: 'Toyota Supra', imageUrl: 'https://via.placeholder.com/400x250', description: 'Sports car known for its speed.' },
        { id: 11, title: 'Tesla Model S', imageUrl: 'https://via.placeholder.com/400x250', description: 'Electric sedan with autopilot.' },
        { id: 21, title: 'Ford Mustang', imageUrl: 'https://via.placeholder.com/400x250', description: 'Classic muscle car with a powerful engine.' },
        { id: 31, title: 'Toyota Supra', imageUrl: 'https://via.placeholder.com/400x250', description: 'Sports car known for its speed.' },
    ];

    const filteredCars = cars.filter(car => car.title.toLowerCase().includes(searchTerm.toLowerCase()));

    return (
        <Container className="py-5">
            <h1 className="text-center mb-4">My Cars</h1>

            {/* Search Input */}
            <div className="mb-4">
                <Form.Control
                    type="text"
                    placeholder="Search cars..."
                    value={searchTerm}
                    onChange={(e) => setSearchTerm(e.target.value)}
                    className="shadow-sm"
                />
            </div>

            {/* Cars List */}
            <Row xs={1} md={2} lg={3} className="g-4">
                {filteredCars.map((car) => (
                    <Col key={car.id}>
                        <Card className="shadow-sm rounded-lg">
                            <Card.Img variant="top" src={car.imageUrl} alt={car.title} className="img-fluid" />
                            <Card.Body>
                                <Card.Title>{car.title}</Card.Title>
                                <Card.Text>{car.description}</Card.Text>
                            </Card.Body>
                        </Card>
                    </Col>
                ))}
            </Row>
        </Container>
    );
};

export default ProductList;
